import React, { Component } from 'react';
import './App.css';
import { Switch, Route } from 'react-router-dom'
import MusicManager from './components/public/MusicManager'
import AuthenticatedRoute from './components/AuthenticatedRoute'
import queryString from 'query-string'
import { connectAdvanced } from 'react-redux';
import { bindActionCreators } from 'redux';
import * as clientConfigActions from './actions/clientConfigActions';
import * as clientInfoHelpers from './utility/clientInfoHelpers';
import { IntlProvider } from "react-intl";//potential for ue for internationalization
import messages_en from './locales/en/common.json' 

import flatten from 'flat';
import { withCookies } from 'react-cookie';
import * as PortalConstants from './utility/constants';
import TagManager from 'react-gtm-module';
import _ from 'lodash';
import CCBLayout from './components/common/CCBLayout';
import P2CLayout from './components/common/P2CLayout';
import { LoadingOutlined } from '@ant-design/icons';
import { Spin } from 'antd';

//TO Show extensible support of internationalization
//support for older browsers e.g IE11, Edge & Safari 13
if (!Intl.RelativeTimeFormat) {

  require('@formatjs/intl-relativetimeformat/polyfill');
  require('@formatjs/intl-relativetimeformat/dist/locale-data/en');

}

const spinIcon = <LoadingOutlined style={{ fontSize: 24 }} spin />;

let i18nConfig = {
  locale: 'en',
  messages: messages_en
};
function getClientNameForQueryParam(location) {
  let params = queryString.parse(location.search);
  return params.connectName;
}

function getAuthToken(props) {
  if (props.userInfo === undefined) {
    return props.cookies.get(PortalConstants.AUTH_TOKEN);
  }

  if (props.userInfo.token !== undefined && props.userInfo.token.accessToken.length > 1)
    return props.userInfo.token.accessToken;
  return props.cookies.get(PortalConstants.AUTH_TOKEN);
}



class App extends Component {

  onChangeLanguage(lang) {
    switch (lang) { 
      case 'en': i18nConfig.messages = flatten(messages_en); break; 
      default: i18nConfig.messages = flatten(messages_en); break;
    }
    this.setState({ locale: lang });
    i18nConfig.locale = lang;
  }

  componentDidUpdate() {

  }



  componentDidMount() {
    Spin.setDefaultIndicator(spinIcon);


    let authToken = this.props.cookies.get(PortalConstants.AUTH_TOKEN);
    if (authToken && authToken.length > 1 && this.props.location.pathname.includes("musicmanager/login")) {
      this.props.history.push("/home");
    }


  }

  loadClient() {
    this.props.actions.loadClientConfig(this.props.config);
  }

  render() {
    const portalName = this.props.nextState ? this.props.nextState.clientConfig.clientData.appName : null;
    return (
      <IntlProvider key={i18nConfig.locale} locale={i18nConfig.locale} messages={i18nConfig.messages}>
        <div style={{ height: "auto" }}>
          <Switch>
            <Route path="/musicmanager" component={MusicManager} />
            {portalName &&
              <AuthenticatedRoute path="/home"
                props=
                {{ authToken: getAuthToken(this.props) }} component={portalName === PortalConstants.CCB_PORTAL ? CCBLayout : P2CLayout} />
            }
            <Route path="/error" component={Error} />
          </Switch>
        </div>
      </IntlProvider>
    );
  }
}


function selectorFactory(dispatch) {
  let ownProps = {}
  let result = {}

  const actions = bindActionCreators(clientConfigActions, dispatch)
  ownProps.actions = actions;
  return (nextState, nextOwnProps) => {
    let params = queryString.parse(nextOwnProps.location.search);
    let cookies = nextOwnProps.cookies;

    var shouldLoadClient = clientInfoHelpers.shouldLoadClient(params, nextOwnProps.location, nextState, cookies);
    if (shouldLoadClient !== true) {
      let cachedResult = { ...nextOwnProps, nextState, loadConfig: shouldLoadClient.loadConfig }
      return cachedResult;
    }

    let config = clientInfoHelpers.createClientConfig(params, cookies);

    let userInfo = {};
    if (nextState.authentication && nextState.authentication.userInfo) {
      userInfo = nextState.authentication.userInfo;
    }
    let nextResult = { ...nextOwnProps, config, userInfo }
    if (!nextOwnProps.actions) {
      nextResult = { ...nextResult, actions }
    }

    if (result !== nextResult) {
      result = nextResult
    }
    return result
  }
}
export default withCookies(connectAdvanced(selectorFactory)(App));
